import './styles.css'

export default function ListingAd({ pic, title, address, description, psf_min, psf_max }) {
  const psf_min_string = psf_min.toLocaleString();
  
  return (
    // <div className="App">
    //   <img className="mainPic" width="300" height="500" src={pic} />
    //   <div className="mainContent">
    //     <h1>{title}</h1>
    //     <p className="address">{address}</p>
    //     <button>See description</button>
    //     <p className="description">{description}</p>
    //   </div>
    // </div>
    <div className="App">
      <div className="picContainer">
        <img className="mainPic" src={pic} />
      </div>
      <div className="mainContent">
        <div className="headerContent">
          <img src="/building-icon.svg" width={40} height={40} />
          <div>
            <p className='titleStyling'>{title}</p>
            <p className='addressStyling'>{address}</p>
          </div>
          <div>
            <p>${psf_min} - ${psf_max}</p>
          </div>
        </div>
      </div>
    </div>
  )
}
